import React from 'react'
import {styles} from "../SupportEngine/styles";


function ContactScreen() {
  return (
    <div
    style={{
      ...styles.ContactScreen,
      ...{opacity: this.props.visible ? '1' : '0'}
    }}></div>
  )
}

export default ContactScreen
